import React, { useState } from "react";
import "./index.css";
 

const App=()=>{

       const state=useState();
       const[count,setcount]=useState(10);


  const IncNum=()=>{
     setcount(count-1);
  }
  return(
    <>
      <h1> {count} </h1>
      <button onClick={IncNum}> Click Me</button>
    </>
  );

}
export default App;
